#define MINI_PP_INC(x) MINI_PP_ASSERT(MINI_PP_IS_INT(x))MINI_PP_ASSERT(MINI_PP_NOT(MINI_PP_IS_EQUAL(MINI_PP_MAX_INT, x)))MINI_PP_TUPLE_GET_ELEM_0(MINI_PP_CAT(MINI_PP_PRIVATE_INT_TOOL_, x)(MINI_PP_PRIVATE_INC_IMPL_REPEAT, dummyParams))
