#define MINI_PP_PRIVATE_IS_LESS_IMPL_B_IS_0_0(a, b) MINI_PP_CAT(MINI_PP_PRIVATE_INT_TOOL_, MINI_PP_DEC(b))(MINI_PP_PRIVATE_IS_LESS_IMPL_REPEAT, a)
